import { CarrosService } from '../carros.service';
import { Component, OnInit } from '@angular/core';
import { Carros } from '../carros';
import { ActivatedRoute, Router } from '@angular/router';

@Component({
  selector: 'app-update-carros',
  templateUrl: './update-carros.component.html',
  styleUrls: ['./update-carros.component.css']
})



export class UpdateCarrosComponent implements OnInit {

 id!: number;
 carros: Carros = new Carros ();

  constructor(private carrosService: CarrosService,
    private router: Router,
    private route: ActivatedRoute) {}



  ngOnInit(): void {

    this.id = this.route.snapshot.params['id'];
    this.carrosService.getCarrosByid(this.id).subscribe({
      next: (data: Carros) => {
        console.log(data)
        this.carros = data
      },
      error: (error: any) => console.log(error),
      complete: () => console.log("Data init comepleted!")
    })

}

onSubmit() {
  this.updateCarros();
}
updateCarros() {
  this.carrosService.updateCarros(this.id, this.carros)
  .subscribe({
    next: (data: any) => console.log(data),
    error: (error: any) => console.log(error),
    complete: () => this.goToCarroList()
  })
}
goToCarroList() {
  this.router.navigate(['/carros-list'])}
}
<div class="col-md-6 offset-md-3">
    <h3 class="cor"> Atualizar Carros</h3>
    <form (ngSubmit) = "onSubmit()">

        <div class="form-group">
            <label class="cor"> Nome: </label>
            <input type="text" class ="form-control" id = "rua"
                [(ngModel)] = "endereco.rua" name = "rua">
        </div>
        <div> </div>
        <div class="form-group">
            <label class="cor"> Número: </label>
            <input type="text" class ="form-control" id = "numero"
                [(ngModel)] = "endereco.numero" name = "numero">
        </div>
        <div> </div>
        <div class="form-group">
            <label class="cor">  Cidade: </label>
            <input type="text" class ="form-control" id = "cidade"
                [(ngModel)] = "endereco.cidade" name = "cidade">
        </div>
        <div> </div>
        <div class="form-group">
            <label class="cor"> Estado: </label>
            <input type="text" class ="form-control" id = "estado"
                [(ngModel)] = "endereco.estado" name = "estado">
        </div>
        <div class="form-group">
            <label class="cor"> CEP: </label>
            <input type="text" class ="form-control" id = "cep"
                [(ngModel)] = "endereco.cep" name = "cep">
        </div>
        <div> </div>
        <div class="form-group">
            <label class="cor"> Complemento: </label>
            <input type="text" class ="form-control" id = "complemento"
                [(ngModel)] = "endereco.complemento" name = "complemento">
        </div>
        <div> </div>
        <button class = "btn btn-success" (click)="updateEndereco()">Atualizar Endereço</button>



    </form>
    </div>
